"""# L3.6 - Formação de números

Faça um programa que permita receber apenas um número inteiro (de no máximo 3 dígitos) e imprima a sua formação em centenas, dezenas e milhares.

Entrada
A entrada está composta por apenas um número inteiro maior a zero e menor a 1000.

Saída
Seu programa deve imprimir a formação do número em ‘centenas’, ‘dezenas’ e ‘unidades’. Veja exemplos de formatação.
![image.png](data:image/png;base64,)
"""

# L3.6
entrada = input()
if len(entrada) == 1:
  print(f"{int(entrada)} unidades")
elif len(entrada) == 2:
  if int(entrada[1]) ==0:
      print(f"{int(entrada[0])} dezenas")
  else:
    print(f"{int(entrada[0])} dezenas\ne \n{int(entrada[1])} unidades")
elif len(entrada) == 3:
  if int(entrada[1]) == 0 and int(entrada[2]) == 0:
    print(f"{int(entrada[0])} centenas")
  elif int(entrada[1]) == 0:
    print(f"{int(entrada[0])} centenas \ne \n{int(entrada[2])} unidades")
  elif int(entrada[2]) == 0:
    print(f"{int(entrada[0])} centenas\ne \n{int(entrada[1])} dezenas")
  else:  
    print(f"{int(entrada[0])} centenas\ne \n{int(entrada[1])} dezenas\ne \n{int(entrada[2])} unidades")

"""#L3.7 - Tempo de jogo em minutos [BÔNUS/OPCIONAL]

Leia a hora inicial, minuto inicial, hora final e minuto final de um jogo. A seguir calcule a duração do jogo, sabendo que o mesmo pode começar em um dia e terminar em outro, tendo uma duração mínima de 1 minuto e duração máxima de 24 horas.

Entrada
A entrada contém quatro valores inteiros representando a hora inicial, o minuto inicial, a hora final e o minuto final.

Saída
Apresente a duração do jogo em horas e minutos conforme exemplos abaixo.

![image.png](data:image/png;base64,)
"""

# L3.7


hrin = int(input())
minin = int(input())
hrfin = int(input())
minfin = int(input())

initial = hrin*60 + minin
final = hrfin*60 + minfin

if initial == final:
  print(f"{24}h{0}m")
elif initial > final:
  print(f"{int((1440 - (initial-final))/60)}h{(1440 - (initial-final))%60}m")
elif final > initial:
    if minfin > minin or minin == minfin:
      print(f"{int((hrfin*60 - hrin*60)/60)}h{minfin-minin}m")
    else:
      print(f"{int(((hrfin*60 - hrin*60)/60)-1)}h{minfin+(60-minin)}m")